// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PizzaDelivery {
    struct TaskState {
        uint taskId;
        address participant;
        bool completed;
    }

    address[3] public participants;
    mapping(uint => TaskState) public taskStates;
    uint public currentState;

    event TaskCompleted(uint indexed taskId, address indexed participant);

    constructor(address[3] memory _participants) {
        participants = _participants;
    }

    function enact(uint taskID) external {
        require(taskID >= 1 && taskID <= 4, "Invalid task ID");

        TaskState storage task = taskStates[taskID];
        require(!task.completed, "Task already completed");

        address caller = msg.sender;
        uint participantIndex = getParticipantIndex(caller);
        require(participantIndex != type(uint).max, "Caller is not a valid participant");

        uint requiredParticipant = getRequiredParticipant(taskID);
        require(participantIndex == requiredParticipant, "Caller is not the required participant for this task");

        // Enforce task order
        if (taskID == 1) {
            require(currentState == 0, "Task 1 must be the first task");
        } else if (taskID == 2) {
            require(currentState == 1, "Task 2 must follow Task 1");
        } else if (taskID == 3) {
            require(currentState == 2, "Task 3 must follow Task 2");
        } else if (taskID == 4) {
            require(currentState == 3, "Task 4 must follow Task 3");
        } else {
            revert("Invalid task order");
        }

        task.completed = true;
        currentState = taskID;
        emit TaskCompleted(taskID, caller);
    }

    function getParticipantIndex(address _addr) internal view returns (uint) {
        if (_addr == participants[0]) return 0;
        if (_addr == participants[1]) return 1;
        if (_addr == participants[2]) return 2;
        return type(uint).max;
    }

    function getRequiredParticipant(uint taskID) internal pure returns (uint) {
        if (taskID == 1) return 0; // Customer
        if (taskID == 2) return 1; // Pizza Place
        if (taskID == 3) return 1; // Pizza Place
        if (taskID == 4) return 2; // Delivery Boy
        return type(uint).max;
    }
}
